import axios from "axios";

const keresek = "http://localhost:8090/api/keres";

class KeresService {
  getKeresek() {
    return axios.get(keresek);
  }

  getKeresById(keresId) {
    return axios.get(keresek + "/" + keresId);
  }
  addKeres(keres) {
    return axios.post(keresek + "/save", keres);
  }
  updateKeres(keres) {
    return axios.post(keresek + "/update", keres);
  }
  deleteKeres(keresId) {
    return axios.delete(keresek + "/" + keresId);
  }
}

export default new KeresService();
